    setName("khairi");
  };
  const [age, setAge] = useState(25);

  return (
    <div className="home">
      <h2>Home Page</h2>
      <p>
        {name} is {age} years old
      </p>
      <button onClick={handleClick}>click me</button>
    </div>
  );
};

export default Home;
